import React from "react";
import { Worker, Viewer } from '@react-pdf-viewer/core';
import { defaultLayoutPlugin } from '@react-pdf-viewer/default-layout';
import '@react-pdf-viewer/core/lib/styles/index.css';
import '@react-pdf-viewer/default-layout/lib/styles/index.css';

function Physics() {
  // Initialize the default layout plugin instance
  const defaultLayoutPluginInstance = defaultLayoutPlugin();

  return (
    <div>
      <h1>This is the Physics page.</h1>
      {/* PDF Viewer */}
      <div style={{ height: '750px', border: '1px solid rgba(0, 0, 0, 0.3)' }}>
        <Worker workerUrl={`https://unpkg.com/pdfjs-dist@2.9.359/build/pdf.worker.min.js`}>
          <Viewer
            fileUrl="../redner/" // Replace with your actual PDF path
            plugins={[defaultLayoutPluginInstance]}
          />
        </Worker>
      </div>
    </div>
  );
}

export default Physics;
